import React, { useState } from 'react';
import HoneycombPlot from './HoneycombPlot';

const App = () => {
  const [easyCount, setEasyCount] = useState(10);
  const [mediumCount, setMediumCount] = useState(5);
  const [hardCount, setHardCount] = useState(3);

  return (
    <div>
      <h1>Honeycomb Plot Example</h1>
      <HoneycombPlot easyCount={easyCount} mediumCount={mediumCount} hardCount={hardCount} width={800} height={600} />
      <div>
        <label>
          Easy Count:
          <input type="number" value={easyCount} onChange={(e) => setEasyCount(+e.target.value)} />
        </label>
        <label>
          Medium Count:
          <input type="number" value={mediumCount} onChange={(e) => setMediumCount(+e.target.value)} />
        </label>
        <label>
          Hard Count:
          <input type="number" value={hardCount} onChange={(e) => setHardCount(+e.target.value)} />
        </label>
      </div>
    </div>
  );
};

export default App;
